import React, { useState } from 'react';
import { useAuth } from '../context/AuthContext';
import { userAPI } from '../utils/api';
import ProfileModal from '../components/ProfileModal';
import StarRating from '../components/UI/StarRating';
import toast from 'react-hot-toast';

const Dashboard = () => {
  const { user, setUser } = useAuth();
  const [isProfileModalOpen, setIsProfileModalOpen] = useState(false);
  const [isUpdatingProfile, setIsUpdatingProfile] = useState(false);
  const [userRating, setUserRating] = useState(3); // Example rating state

  const handleProfileUpdate = async (updateData) => {
    try {
      setIsUpdatingProfile(true);
      console.log('ðŸ“ Dashboard - Updating profile with:', updateData);
      
      const response = await userAPI.updateProfile(updateData);
      
      console.log('âœ… Dashboard - Profile updated successfully:', response.data);
      toast.success('Profile updated successfully!');
      
      // Update local user state
      setUser(response.data.user);
      setIsProfileModalOpen(false);
      
    } catch (error) {
      console.error('âŒ Dashboard - Profile update error:', error);
      toast.error(error.response?.data?.message || 'Failed to update profile');
    } finally {
      setIsUpdatingProfile(false);
    }
  };

  const handleRatingChange = (newRating) => {
    setUserRating(newRating);
    // Here you would typically submit the rating to your API
    console.log('ðŸŒŸ New rating:', newRating);
  };

  return (
    <div className="space-y-6">
      <div className="flex justify-between items-center">
        <h1 className="text-2xl font-bold">Dashboard</h1>
        <button 
          onClick={() => setIsProfileModalOpen(true)}
          className="bg-primary-600 hover:bg-primary-700 text-white px-4 py-2 rounded-lg"
        >
          Edit Profile
        </button>
      </div>

      {/* Profile Info */}
      <div className="bg-white dark:bg-gray-800 p-6 rounded-lg shadow">
        <h2 className="text-xl font-semibold mb-4">Profile Information</h2>
        <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
          <div>
            <label className="block text-sm font-medium text-gray-600 dark:text-gray-400">Name</label>
            <p className="text-gray-900 dark:text-gray-100">{user?.name}</p>
          </div>
          <div>
            <label className="block text-sm font-medium text-gray-600 dark:text-gray-400">Email</label>
            <p className="text-gray-900 dark:text-gray-100">{user?.email}</p>
          </div>
          <div>
            <label className="block text-sm font-medium text-gray-600 dark:text-gray-400">Role</label>
            <p className="text-gray-900 dark:text-gray-100 capitalize">{user?.role?.replace('_', ' ')}</p>
          </div>
          <div>
            <label className="block text-sm font-medium text-gray-600 dark:text-gray-400">Address</label>
            <p className="text-gray-900 dark:text-gray-100">{user?.address || 'Not provided'}</p>
          </div>
        </div>
      </div>

      {/* Rating Example */}
      <div className="bg-white dark:bg-gray-800 p-6 rounded-lg shadow">
        <h2 className="text-xl font-semibold mb-4">Rate This Service</h2>
        <div className="flex items-center space-x-4">
          <StarRating 
            rating={userRating}
            onRatingChange={handleRatingChange}
            size="lg"
            showValue={true}
          />
          <span className="text-gray-600 dark:text-gray-400">
            Click stars to rate
          </span>
        </div>
      </div>

      {/* Profile Modal */}
      <ProfileModal
        isOpen={isProfileModalOpen}
        onClose={() => setIsProfileModalOpen(false)}
        user={user}
        onUpdate={handleProfileUpdate}
        isUpdating={isUpdatingProfile}
      />
    </div>
  );
};

export default Dashboard;
